import React, {useState, useEffect} from 'react';
import 'bootstrapp/dist/css/bootstrapp.min.css'
import './App.css';

function App() {

  const [movies, setMovies] = useState([
    {Title: 'Movie 1', Year: 2020, Type: "movie", Poster: "https://sm.ign.com/ign_fr/cover/l/les-gardie/les-gardiens-de-la-galaxie-3_htrs.jpg"},
    {Title: 'Movie 2', Year: 2021, Type: "movie", Poster: "https://sm.ign.com/ign_fr/cover/l/les-gardie/les-gardiens-de-la-galaxie-3_htrs.jpg"},
    {Title: 'Movie 3', Year: 2022, Type: "movie", Poster: "https://sm.ign.com/ign_fr/cover/l/les-gardie/les-gardiens-de-la-galaxie-3_htrs.jpg"},
  ]);

  return (
    <div className="container-fluid movie-app">
      <div className="row">
        <MovieList 
          movies={movies}
        />
      </div>
    </div>
  );
}

export default App;
